import * as React from "react";
import styled from "styled-components";

function SideMenuButton(props) {
  return (
    <svg data-name="Layer 1" viewBox="0 0 216 144" {...props}>
      <path
        d="M144 0H0v144h144a72 72 0 000-144zm0 135a63 63 0 1163-63 63 63 0 01-63 63z"
        fill="#9f7bc9"
      />
    </svg>
  );
}

const MemoSideMenuButton = React.memo(SideMenuButton);

const StyledButton = styled(MemoSideMenuButton)`
  width: 5vw;
  position: relative;
  left: 0;
`;

export default StyledButton;
